import React, { useState } from 'react';
import './App.css';


const App = () => {
  const [lekcje, setLekcje] = useState({
    poniedziałek: ["j. polski", "TiDA-2/2", "TiDA-2/2", "matematyka", "r_angielski-Ja2", "wf-w2", "zaj. wych."],
    wtorek: ["j. polski", "matematyka", "PAWEB-2/2", "PAWEB-2/2", "wf-w2", "R/E", " "],
    środa: [" ", "r_matematyka", "j. angielski-Ja2", "PrAM-2/2", "PrAM-2/2", "PrAM-2/2", "PrAM-2/2"],
    czwartek: ["matematyka", "j. polski", "PrTiDA-2/2", "PrTiDA-2/2", "wf-w2", "R/E", " "],
    piątek: [" ", "j. angielski-Ja2", "PrAWEB-2/2", "PrAWEB-2/2", "PrAWEB-2/2", "PrAWEB-2/2", " "]
  });

  const godziny = [
    "8:00-8:45",
    "8:50-9:35",
    "9:40-10:25",
    "10:45-11:30",
    "11:35-12:20",
    "12:25-13:10",
    "13:15-14:00"
  ];

  return (
    <div>
      <table cellSpacing="10">
        <thead>
          <tr>
            <th>Nr lekcji </th><th>Godzina</th>
            {Object.keys(lekcje).map((dzien, index) => (
              <th key={index}>{dzien}</th>
            ))}
          </tr>
        </thead>
        <tbody>
          {Array.from({ length: 7 }).map((_, lekcjaIndex) => (
            <tr key={lekcjaIndex}>
              <td>{`Lekcja ${lekcjaIndex + 1}`}</td>
              <td> {`(${godziny[lekcjaIndex]})`}</td>
              {Object.values(lekcje).map((lekcjeDnia, index) => (
                <td key={index}>
                  {lekcjeDnia[lekcjaIndex] || " "}
                </td>
              ))}
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default App;
